<?php
$db = new SQLite3('users.db');

// create users table if not exists
$db->exec("CREATE TABLE IF NOT EXISTS users (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    username TEXT UNIQUE,
    password TEXT,
    token TEXT,
    pfp TEXT,
    alt TEXT
)");

