// random hex generator
function randhex($len = 50) {
    return bin2hex(random_bytes($len/2));
}

// base64 placeholder
$pfp_placeholder1 = "" ;// long string
$pfp_placeholder2 = "" ;

// insert user1
$stmt = $db->prepare("INSERT OR IGNORE INTO users (username, password, token, pfp, alt) VALUES (:u, :p, :t, :pfp, :alt)");
$stmt->bindValue(":u", "user1", SQLITE3_TEXT);
$stmt->bindValue(":p", "pass1", SQLITE3_TEXT);
$stmt->bindValue(":t", randhex(50), SQLITE3_TEXT);
$stmt->bindValue(":pfp", $pfp_placeholder1, SQLITE3_TEXT);
$stmt->bindValue(":alt", "blank_pic:(", SQLITE3_TEXT);
$stmt->execute();

